import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // Locate and click the shopping cart element
    // The element has the class "cart" and contains the text "Cart"
    const cartButton = page.locator('div.cart:has-text("Cart")');
    await cartButton.click();

    // Wait for the cart modal to become visible
    const cartModal = page.locator('.modal-content:has-text("Your Shopping Cart")');
    await cartModal.waitFor({ state: 'visible', timeout: 5000 });

    // Take a screenshot of the open modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal_open.png'));

    // Extract data to verify the modal is open and has the expected content
    const isModalVisible = await cartModal.isVisible();
    const modalContent = await page.locator('.empty-cart').textContent();

    return {
      success: true,
      action: "Successfully opened the shopping cart modal.",
      extractedData: {
        isModalVisible: isModalVisible,
        emptyCartMessage: modalContent.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));

    return {
      success: false,
      action: "Failed to open the shopping cart modal.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
